pragma solidity ^0.6.2;

import "./ZToken.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/EnumerableSet.sol";

////////////////////////////////////////////////////////////////////////////////////////////
/// @title ZDAO
/// @author Christopher Dixon
////////////////////////////////////////////////////////////////////////////////////////////
/**
The ZDAO contract is designed to be a bare bones, minimalistic approach to a versitile DAO structure. The ZDAO is designed to
    work with other contracts including other zer0 based contracts AND approved non-zer0 based contracts.
**/

contract ZDAO is Ownable {

    using SafeMath for uint256;
    /// @notice repToken is the address of the ERC20 token a zDAO is using for its reputation
    ZToken public repToken;
    /// @notice daoName is the name of the DAO
    string public daoName;
    /// @notice proposalID is used to track proposals
    uint256 public proposalID;
    /// @notice proposalTime is the time in seconds a proposal is considered active
    uint256 public proposalTime;
    /// @notice quorum is the minimum percentage of voteWeight needed for a vote to pass
    uint256 public quorum;
    /// @notice transferable is used to determine if a members position needs to be check when voting
    bool public isTransferable;

    /// @notice approvedInteractionContracts tracks which contracts the DAO has been approved to interact with
    mapping(address => bool) public approvedInteractionContracts;
    /// @notice approvedMintContracts is a mapping of which addresses have the ability to call the proxyMint function
    mapping(address => bool) public approvedMintContracts;
    /// @notice approvedBurnContracts is a mapping of which addresses have the ability to call the proxyBurn function
    mapping(address => bool) public approvedBurnContracts;

    Proposal[] public proposals;

    modifier onlyApprovedMinter() {
        require(
            approvedMintContracts[msg.sender] == true,
            "Caller is not an approved Minter address"
        );
        _;
    }

    modifier onlyApprovedBurner() {
        require(
            approvedBurnContracts[msg.sender] == true,
            "Caller is not an approved Burner address"
        );
        _;
    }

    /**
    @notice the modifier onlyMember requires that the function caller must be a member of the DAO to call a function
    **/
    modifier onlyMember() {
        require(
            repToken.balanceOf(msg.sender) >= 1e18,
            "You are not a member of this DAO"
        );
        _;
    }

    struct Proposal {
        address maker;
        address payable target;
        uint256 amount;
        uint256 timeCreated;
        uint256 voteWeights;
        bool executed;
        bool proposalPassed;
        string proposalHash;
        bytes call_data;
        Vote[] votes;
        mapping(address => bool) voted;
    }

    struct Vote {
        bool inSupport;
        address voter;
        uint voteWeight;
    }

    /**
     @notice the constructor function is fired only once during contract creation and is used to set up
        the zDAO
     @dev this function automatically deploys a rep token for the DAO if the _existingToken param is set to the 0x0 address
     @param _daoName is the name of the zDAO
     @param _tokenName is the name of the DAO's rep token(if applicable)
     @param _tokenSym is the symbol of the DAO's rep token(if applicable)
     @param _existingToken is the address of an existing ERC20 the DAO will use as a rep token(If applicable)
     @param _transferableRep is a bool representing whether or not a DAO's rep token can be transfered from one account to another
     @param _quorum is the minimum percentage of voteWeight needed for a vote to pass
     @param _proposalTime is the time in seconds that a proposal will be active for
    **/
    constructor(
        string memory _daoName,
        string memory _tokenName,
        string memory _tokenSym,
        address _existingToken,
        address _DAOcreator,
        bool _transferableRep,
        uint256 _quorum,
        uint256 _proposalTime
    ) public {
        if (_existingToken == 0x0000000000000000000000000000000000000000) {
            ZToken daoToken =
                new ZToken(
                    _tokenName,
                    _tokenSym,
                    _transferableRep,
                    true,
                    _DAOcreator
                );
            repToken = daoToken;
        } else {
            repToken = ZToken(_existingToken);
        }
        daoName = _daoName;
        isTransferable = _transferableRep;
        quorum = _quorum;
        proposalTime = _proposalTime;
    }

     receive() external payable {}

    function newProposal(
        address payable _target,
        string memory _proposalHash,
        uint256 _amount,
        bytes memory _calldata
    ) public payable onlyMember returns (uint256) {
        proposalID++;
        Proposal storage p = proposals[proposalID];
        p.maker = msg.sender;
        p.target = _target;
        p.amount = _amount;
        p.timeCreated = now;
        p.proposalHash = _proposalHash;
        p.call_data = _calldata;
        return proposalID;
    }

    function setQuorum(uint256 _quorum) public onlyOwner {
        quorum = _quorum;
    }

    /**
    @notice percent is an internal function used to calculate the ratio between a given numerator && denominator
    @param _numerator is the numerator of the equation
    @param _denominator is the denominator of the equation
    @param _precision is a precision point to ensure that decimals dont trail outside what the EVM can handle
    **/
    function _percent(
        uint256 _numerator,
        uint256 _denominator,
        uint256 _precision
    ) internal pure returns (uint256 quotient) {
        // caution, check safe-to-multiply here
        uint256 numerator = _numerator * 10**(_precision + 1);
        // with rounding of last digit
        uint256 _quotient = ((numerator / _denominator) + 5) / 10;
        return (_quotient);
    }

    /**
    @notice _checkThreshold is an internal function used by a vote counts to see if enough of the community has voted
    @param _numOfvotes is the total number of votes a proposal has received
    @param _numOfmem is the total number of members in the DAO
    @notice this function returns a bool
                -true if the threshold is met
                -false if the threshold is not met
    **/
    function _checkThreshold(uint256 _numOfvotes, uint256 _numOfmem)
        internal
        view
        returns (bool)
    {
        uint256 percOfMemVoted = _percent(_numOfvotes, _numOfmem, 2);
        if (percOfMemVoted >= quorum) {
            return true;
        } else {
            return false;
        }
    }

    /**
    @notice the vote function allows a DAO member to vote on proposals made to the DAO
    @param _ProposalID is the number ID associated with the particular proposal the user wishes to vote on
    @param  supportsProposal is a bool value(true or false) representing whether or not a member supports a proposal
                    -true if they do support the proposal
                    -false if they do not support the proposal
    @dev this function will trigger the _checkThreshold function which determines if enough members have voted to
              fire the executeVote function.
    **/
    function vote(uint256 _ProposalID, bool supportsProposal)
        public
        onlyMember
    {
        Proposal storage p = proposals[_ProposalID];
        require(p.voted[msg.sender] != true);
        uint256 voteID = p.votes.length;
        voteID++;
        uint vw = repToken.balanceOf(msg.sender);
        p.votes[voteID] = Vote({
            inSupport: supportsProposal,
            voter: msg.sender,
            voteWeight: vw
        });
        p.voteWeights = p.voteWeights.add(vw);
        p.voted[msg.sender] = true;
        bool met = false;
        uint ts = repToken.totalSupply();

        //checks if enough members have voted
        met = _checkThreshold(p.voteWeights, ts);
        //if the threshold is met, count the votes
        if (met) {
            executeProposal(_ProposalID);
        }
    }

    // in order for a proposal to execute the votes for YES have to be more the quorum
    function executeProposal(uint256 _proposalID) internal {
      Proposal storage p = proposals[_proposalID];
        if (now.sub(p.timeCreated) >= proposalTime) {
            // mark the proposal as executed and failed
            p.executed = true;
            p.proposalPassed = false;
        } else {
            // sets p equal to the specific proposalNumber
            require(!p.executed, "This proposal has already been executed");

            uint256 yea = 0;
            uint256 nay = 0;

            //this for loop cycles through each members vote and adds its value to the yea or nay tally
            for (uint256 i = 0; i < p.votes.length; ++i) {
                Vote storage v = p.votes[i];
                if (v.inSupport) {
                    yea = yea.add(v.voteWeight);
                } else {
                    nay = nay.add(v.voteWeight);
                }
            }

            //check if the yea votes outway the nay votes
            if (yea > nay) {
                (bool success, bytes memory data) =
                    p.target.call{value: p.amount}(p.call_data);
                require(success);
                ///mark the proposal as executed and passed
                p.executed = true;
                p.proposalPassed = true;
            } else {
                // mark the proposal as executed and failed
                p.executed = true;
                p.proposalPassed = false;
            }
        }
    }
}

